import React from 'react'
import Carousel from '../componentes/Carousel'

function Galeria() {
    return (
      <div>
         <div>
         <br/>
         
        <h1 className="center">Galeria</h1>  
        <br/>  
        <Carousel/>            
      </div>
      
    </div>         
    )    
  }

  
  export default Galeria;
